import React from 'react';

class ListaAula extends React.Component{
    constructor(props){
        super()
    } 
    componentDidMount(){
         console.log("Hello World!");
         console.log("props: ", this.props.dados);
    }

    render(){
        return (
        <>
                <ul id="listAaula">
                    { this.props.dados.map((aula, i) =>
                        <li key={i}> {aula}</li>
                        )
                    }
                </ul>
        </>);
    }

}
export default ListaAula;
